import {BrowserRouter, Route, Routes} from "react-router-dom";
import Layout from "./Layout";
import Home from "./Home";
import WeeklyLeaderboard from "./WeeklyLeaderboard";
import React, {Component} from "react";
import DailyLeaderBoard from "./DailyLeaderBoard";



class App extends Component {
    constructor(props) {
        super(props);
        this.state = {value: ''};

        this.handleChange = this.handleChange.bind(this);
    }


    createUser(){
        const requestOptions = {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({
                userEmail: this.state.value
            })
        };
        fetch('/api/sudokleQueries/addUser', requestOptions)
            .then(response => console.log(response.json()));
    };

    handleChange(event) {
        this.setState({value: event.target.value});
    }

    handleSubmit(event) {
        this.createUser();
        event.preventDefault();
    }



    render() {


        return (
            <div>
                <BrowserRouter>
                    <Routes>
                        <Route path="/" element={<Layout/>}>
                            <Route index element={<Home/>} />
                            <Route path="DailyLeaderboard" element={<DailyLeaderBoard/>} />
                            <Route path="WeeklyLeaderboard" element={<WeeklyLeaderboard/>} />
                        </Route>
                    </Routes>
                </BrowserRouter>

                <form onSubmit={this.handleSubmit}>
                    <label>
                        Email:
                        <input type="text" value={this.state.value} onChange={this.handleChange} />
                    </label>
                    <input type="submit" value="Add Test User" />
                </form>


            </div>

        );
    }
}

export default App;
